import React from 'react';
import Router from './Router';
import { BrowserRouter, Switch } from 'react-router-dom';

const App = (props) => (
  <BrowserRouter>
    <Switch>
      <Router {...props} />
    </Switch>
  </BrowserRouter>
);

export default App;
